description:
Offspring (2009)  

Verenigde Staten
Horror
100 minuten

geregisseerd door Andrew van den Houten
met Amy Hargreaves, Pollyanna McIntosh en Art Hindle

Amy Halbard en Claire Carey zijn ontvoerd door een stel moordlustige kannibalen en het enige wat zij nu willen is overleven. HIernaast zullen zij ook nog eens hun kinderen moeten proberen te beschermen tegen de gevaarlijke vleeseters.

Vertaling: Daboy, Depositair, Delapluma.
Voor: Simply ReleaseS Toppers.
